const CartReducer = (state,action) => {
    switch(action.type){
        case 'FETCH_ALL_CART':
            return state
        case 'ADD_CART':
            return state
        case 'DELETE_CART':
            return state
        case 'UPDATE_CART':
            return state
    }
}

export default CartReducer
